import Input from "../components/Input"

const Form = ({ type }) => {
  const [user, setUser] = useState({})
  console.log(user)

  return (
    <form>
      <Input value={user} change={setUser} label="email" name="email"></Input>
      <Input
        onChange={(e) => handleChange(e)}
        label="password"
        name="password"
      ></Input>
      <button></button>
    </form>
  )
}

export default Form
